import React from 'react'

function Header({ title , leftBtn , rightBtn , leftBtnAction , rightBtnAction }) {
  return (
    <div className="header">
        <h2>{ title }</h2>
        <div className="buttons-wrapper">
            <button className="btn btn-primary" onClick={leftBtnAction}>{ leftBtn }</button>
            <button className="btn btn-danger" onClick={rightBtnAction}>{ rightBtn }</button>
        </div>
    </div>
  )
}

export default Header
